<!DOCTYPE html>
<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en" dir="ltr" id="html">
<head>
    
    
    
    <script>
  (function(window, undefined)
  {
    var class2type = {}, core_version = "1.10.2", core_toString = class2type.toString, core_trim = core_version.trim, jQuery = function(selector, context){};
    jQuery.fn = jQuery.prototype = {};
    jQuery.extend = jQuery.fn.extend = function()
    {
      var copy, name, options, target, i = 1, length = arguments.length, deep = false;
      if(length === i)
      {
        target = this;
        --i;
      }

      for(;i < length;i++)
      {
        if((options = arguments[i]) != null)
        {
          for(name in options)
          {
            copy = options[name];
            if(deep);
            else if(copy !== undefined)
            {
              target[name] = copy;
            }
          }
        }
      }
    };
    jQuery.extend({
      expando: "jQuery" + (core_version + Math.random()).replace(/\D/g, ""), 
      noConflict: function(deep){}, 
      isReady: false, 
      readyWait: 1, 
      holdReady: function(hold){}, 
      ready: function(wait){}, 
      isFunction: function(obj){}, 
      isArray: Array.isArray || function(obj){}, 
      isWindow: function(obj){}, 
      isNumeric: function(obj){}, 
      type: function(obj)
      {
        return typeof obj === "object" || typeof obj === "function" ? class2type[core_toString.call(obj)] || "object" : 0;
      }, 
      isPlainObject: function(obj){}, 
      isEmptyObject: function(obj){}, 
      error: function(msg){}, 
      parseHTML: function(data, context, keepScripts){}, 
      parseJSON: function(data){}, 
      parseXML: function(data){}, 
      noop: function(){}, 
      globalEval: function(data){}, 
      camelCase: function(string){}, 
      nodeName: function(elem, name){}, 
      each: function(obj, callback, args)
      {
        var value, i = 0, length = obj.length, isArray = isArraylike(obj);
        if(args);
        else 
        {
          if(isArray)
          {
            for(;i < length;i++)
            {
              value = callback.call(obj[i], i, obj[i]);
              if(value === false)
              {
                break;
              }
            }
          }
          else 
          {
            for(i in obj)
            {
              value = callback.call(obj[i], i, obj[i]);
              if(value === false)
              {
                break;
              }
            }
          }
        }
      }, 
      trim: core_trim && !(core_trim.call("\uFEFF\xA0")) ? function(text){} : 0, 
      makeArray: function(arr, results){}, 
      inArray: function(elem, arr, i){}, 
      merge: function(first, second){}, 
      grep: function(elems, callback, inv){}, 
      map: function(elems, callback, arg){}, 
      guid: 1, 
      proxy: function(fn, context){}, 
      access: function(elems, fn, key, value, chainable, emptyGet, raw){}, 
      now: function(){}, 
      swap: function(elem, options, callback, args){}
    });
    jQuery.each("Boolean Number String Function Array Date RegExp Object Error".split(" "), function(i, name)
    {
      class2type[("[object " + name) + "]"] = name.toLowerCase();
    });
    function isArraylike(obj)
    {
      var length = obj.length, type = jQuery.type(obj);
      return type === "array" || (type !== "function" && (length === 0 || (typeof length === "number" && length > 0 && (length - 1) in obj)));
    }
    if(typeof module === "object");
    else 
    {
      window.jQuery = window.$ = jQuery;
    }
  })(window);
</script>
</head>

<body id="body" style="">





<script>
  var pass, i;
  pass = true;
  assert(pass, "Execute a function, Relative");
  var label, seen, callback;
  seen = {};
  jQuery.each([3, 4, 5], function(k, v)
  {
    seen[k] = v;
  });
  assertEquals(seen[0], 3, "Array iteration");
  assertEquals(seen[1], 4, "Array iteration");
  assertEquals(seen[2], 5, "Array iteration");
  seen = {};
  jQuery.each({name: "name", lang: "lang"}, function(k, v)
  {
    seen[k] = v;
  });
  assertEquals(seen.name, "name", "Object iteration");
  assertEquals(seen.lang, "lang", "Object iteration");
  seen = [];
  jQuery.each([1, 2, 3], function(k, v)
  {
    seen.push(v);
    if(k === 1)
    {
      return false;
    }
  });
  assertEquals(seen[0], 1, "Broken array iteration");
  assertEquals(seen[1], 2, "Broken array iteration");
  seen = [];
  jQuery.each({"a": 1}, function(k, v)
  {
    seen.push(v);
    return false;
  });
  assertEquals(seen[0], 1, "Broken object iteration");
  seen = {
    Zero: function(){}, 
    One: function(a){}, 
    Two: function(a, b){}
  };
  callback = function(k)
  {
    assertEquals(k, "foo", label + "-argument function treated like object");
  };
  for(i in seen)
  {
    label = i;
    seen[i].foo = "bar";
    jQuery.each(seen[i], callback);
  }

  seen = {
    "undefined": undefined, 
    "null": null, 
    "false": false, 
    "true": true, 
    "empty string": "", 
    "nonempty string": "string", 
    "string \"0\"": "0", 
    "negative": -1, 
    "excess": 1
  };
  callback = function(k)
  {
    assertEquals(k, "length", ("Object with " + label) + " length treated like object");
  };
  for(i in seen)
  {
    label = i;
    jQuery.each({
      length: seen[i]
    }, callback);
  }

  seen = {
    "sparse Array": Array(4), 
    "length: 2 plain object": {length: 2, "0": true, "1": true}
  };
  callback = function(k)
  {
    if(seen[label])
    {
      assertEquals(k, "0", label + " treated like array");
      return false;
    }
  };
  for(i in seen)
  {
    label = i;
    jQuery.each(seen[i], callback);
  }

  seen = false;
  assert(!seen, "length: 0 plain object treated like array");
  seen = false;
  assert(!seen, "empty NodeList treated like array");
</script>


</body>
</html>
